import styled from 'styled-components';

export const Content = styled.div`
  padding: 20px;
  margin: 50px auto 0;
  border-style: solid;
`;

export const Text = styled.div`
  font-size: 1.5rem;
  width: fit-content;
  border-style: solid;
  margin: 0 auto;
`;
